import React from "react";
import {
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  Dot,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";
import "./SlickCard.css";

const SlickCard = () => {
  return (
    <CarouselProvider
      naturalSlideWidth={200}
      naturalSlideHeight={300}
      totalSlides={3}
      className="row"
    >
      <Slider className="col s10">
        <Slide index={1}>
          <ImageWithZoom src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg" />
        </Slide>
      </Slider>
      <div className="dots col s2">
        <Dot slide={1}>1</Dot>
      </div>
    </CarouselProvider>
  );
};

export default SlickCard;
